import React from 'react';
import { Link } from 'react-router-dom';

function MarketItem(props) {
  return (
    <>
        <a className={props.nameClass} href={props.path}>
            <img
              className='market__item__img'
              alt='Market item'
              src={props.src}
            />
        </a>
    </>
  );
}

export default MarketItem;
